        <Container fluid>
            <Row>
                <Col>
                    <img src='https://via.placeholder.com/1000x500.png?text=Lorem+ipsum+dolor+sit+amet' className='mx-auto d-block' alt="placeholder" />
                </Col>
            </Row>
        </Container>)
}

export default Banner;
